INSERT INTO `tab_hotel` VALUES (2, '丁香9号民宿', '日照姑苏丁香9号民宿隐匿于姑苏古巷－－丁香巷，据说戴望舒先生的《雨巷》所描述的即是此巷。紧邻历史文化名街－－平江路，闹中取静。古巷老宅，有露台有厨房，喝茶聊天，抚琴赏月，风月无边。我们欢迎懂尊重，讲文明，有情怀的朋友来这里相聚。', 'img/hotel/2.jpg', 0, '沱江镇江南东路金家园326号', '0352-2382222', 5);
INSERT INTO `tab_hotel` VALUES (3, '花筑·裕大俚舍民宿', '花筑·青岛裕大俚舍民宿位于中国历史文化名镇－新场，属千年古镇的包桥景区。我们整合了三座古宅，主体由民国20年建造的裕大南货店修缮而来，秉承“天人合一”的设计理念，保留了原建筑的木结构、老砖墙、坡屋面和烽火墙，加入了低调简约且符合当代生活品质的元素。', 'img/hotel/3.jpg', 0, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 5);
INSERT INTO `tab_hotel` VALUES (4, '源来客栈', '位于青岛市金泽镇岑卜村，北接淀山湖，西临大观园，东靠郊野公园，南依金泽古镇。至上海市区，车程约1小时；至上海虹桥枢纽，车程约40分钟。', 'img/hotel/4.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 5);
INSERT INTO `tab_hotel` VALUES (5, '碧屋慢生活精品客栈', '酒店毗邻青城山，距离着名景区凤栖山500米，与凤栖山景区隔河相望，只需步行15分钟既可到达景区徒步栈道。在这里，疲惫时，一杯清茶或咖啡，消磨一段悠闲安逸的时光，远离都市的喧哗，洗净自身的疲乏，尽情感受碧屋慢生活精品客栈带给您美好的回忆。', 'img/hotel/5.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 16);
INSERT INTO `tab_hotel` VALUES (6, '了凡民宿', '威海了凡民宿为（非传统酒店客房）标准的1居室一厨一卫，独立客厅带落地大露台为活动休闲空间及独立房间，经设计改造后给你舒服安全干净的住宿环境和体验。', 'img/hotel/6.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 16);
INSERT INTO `tab_hotel` VALUES (7, '云舍客栈', '烟台曾厝垵云舍客栈位于美丽的渔村曾厝垵，交通便利。周边有著名的胡里山炮台、厦门大学、中山路步行街的景点。', 'img/hotel/7.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 16);
INSERT INTO `tab_hotel` VALUES (8, '蓝莲花开·溪上', '蓝莲花开青芝坞的民宿，每一个房间都有自己的特点。欧美风与中式元素和谐搭配，把小资情调，调和得淋漓尽致。从这里，步行约三五分钟，便到了杭州植物园，曲径通幽的小路，高耸入云的古树，是不错的漫步区。坐在店里，呷一口龙井茶，或来一杯咖啡，品味把生活过成诗的时间与空间。　', 'img/hotel/8.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 16);
INSERT INTO `tab_hotel` VALUES (9, '慢享时光海景客栈', '威海慢享时光海景客栈拥有整洁、舒适的客房，房内设施齐全，床上用品洁净卫生，是您温馨、便捷的旅途驿站。', 'img/hotel/9.jpg', 1, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 16);
INSERT INTO `tab_hotel` VALUES (10, '溪西居温泉民宿', '溪西居以打造精品民宿为目的，主人倾注十年心血打造了一个岭南式的私家园林。在这里，你可以和朋友煮茶论道，品香读书；也可以在花园中漫步，春赏桃红，夏享清凉，秋闻桂香，冬探腊梅。', 'img/hotel/10.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 16);
INSERT INTO `tab_hotel` VALUES (11, '梅地亚君澜度假酒店', '这里的客房宽敞又舒适，晚上十分安静，夏日开窗可听到蛙声一片，很有大自然的气息。室外有两个泳池及儿童乐园，室内是一个恒温泳池，可以与小朋友一起玩水嬉戏，或者在一旁吹吹风，也很惬意。', 'img/hotel/11.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 17);
INSERT INTO `tab_hotel` VALUES (12, '梁鸿湿地丽笙度假酒店', '日照梁鸿湿地丽笙度假酒店位于滨湖区鸿山街道飞凤路，与梁鸿湿地公园、中华赏石园、鸿山遗址博物馆等景点近在咫尺，同时毗邻高新区内各大企业，交通便利。', 'img/hotel/12.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 17);
INSERT INTO `tab_hotel` VALUES (13, '海棠湾开维万达文华度假酒店', '潍坊海棠湾开维万达文华度假酒店地处湾海棠北路、素有“国家海岸•海棠湾”绵延20公里的原生态黄金海岸线上，正对浪漫天堂——蜈支洲岛。', 'img/hotel/13.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 17);
INSERT INTO `tab_hotel` VALUES (14, '阿尔卡迪亚阳光度假酒店', '黄山阿尔卡迪亚阳光度假酒店迎八方来宾，海纳百川，放下世俗凡事，随遇而安。\r\n\r\n看太平湖美景，放飞思想，明醒自身，凝聚美好风景，享受美好生活。\r\n\r\n让您停下步伐，回归自然，倾听自然的声音，享受自然的乐趣。', 'img/hotel/14.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 17);
INSERT INTO `tab_hotel` VALUES (15, '湾红树林度假世界', '济南湾红树林度假世界，立足于将中国当下好的时尚、艺术、休闲、娱乐、购物等元素融入度假综合体，引领全新的度假生活方式。度假世界毗邻享有“椰梦长廊”美誉的三亚湾，拥有6座不同风格酒店', 'img/hotel/15.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 17);
INSERT INTO `tab_hotel` VALUES (16, '海上威尼斯酒店', '酒店临海而立，精心移植海南原版白沙，打造3.5公里碧海银滩，为宾客带来惬意海滨度假体验，共计拥有1200余间视野开阔的豪华客房，配备十余个风格各异的主题餐厅，三层乐世界儿童王国为孩子打造梦幻游乐王国。', 'img/hotel/16.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 17);
INSERT INTO `tab_hotel` VALUES (17, '阿尔卡迪亚滨海度假酒店', '东营滨海度假酒店位于秦皇岛市北戴河新区,素有中国美丽八大海岸之一的黄金海岸。酒店依海而建，自然环境得天独厚。长达2000余米的私属海滩与千亩的草地融为一体，以海串联的温泉、滑雪等配套，给你和家人不一样的海派体验。', 'img/hotel/17.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 17);
INSERT INTO `tab_hotel` VALUES (18, '南园宾馆', '宾馆拥有一个660平方米的无柱式多功能厅，以及各类多功能会议厅；专业的会议销售团队及会议服务部门，为客人提供各种活动的专人一站式服务。健身中心配备齐全的健身设施，乒乓球馆、室外网球场，以及SPA休闲中心，是您身心放松的上佳选择。', 'img/hotel/18.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 17);
INSERT INTO `tab_hotel` VALUES (19, '国光豪生度假酒店', '吃过丰富的早餐后，不妨带着孩子去宽阔的绿地上散步消食。沿着私人通道可以来到沙滩，凭房卡换毛巾、使用保险箱很方便，躺在休闲椅上看孩子逐浪戏沙也很惬意。不想出门的话，室内外泳池、温泉池、鱼疗池和儿童游乐场都是亲子活动的不错选择。', 'img/hotel/19.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 17);
INSERT INTO `tab_hotel` VALUES (20, '溧阳涵田度假村酒店', '吃过丰富的早点，不妨带着孩子散步到山上赏湖景；温泉区有充满海洋球的儿童池和中型滑梯，很受孩子们喜欢。在山顶临湖的几个温泉池，还可以边泡澡边欣赏风景，让你心醉。', 'img/hotel/20.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 17);
INSERT INTO `tab_hotel` VALUES (21, '西柚青年旅宿', '西柚青年旅宿座落在济南静安里街，毗邻三元桥交通枢纽中心和首都国际机场，交通非常便利。半个小时即可到达三里屯、东直门区域，优越的地理位置可以满足你的各种需要，不管是商务办公还是休闲娱乐。', 'img/hotel/21.jpg', 1, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 18);
INSERT INTO `tab_hotel` VALUES (22, '过客青年旅舍', '旅舍的公共面积宽广，一楼的大厅古色古香，书架上的桌游可以免费使用，可以组局玩游戏。书台上的毛笔也可以让游客体验一下挥毫的快感。穿过大厅的后花园位于小山的半山腰，视野极佳，山坡上的蛋蛋椅坐着晒太阳，泡壶清茶，懒洋洋地窝一下午也是一个很棒的选择。', 'img/hotel/22.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 18);
INSERT INTO `tab_hotel` VALUES (23, '青之莲青年旅舍', '青之莲设施高档，配备星级酒店使用的美国舒达床垫、鹅绒垫、鹅绒被、鹅绒枕，高档床品、巾类及一次性洗漱用品，真正做到了将高品质的享受与合理化的收费完美结合。', 'img/hotel/23.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 18);
INSERT INTO `tab_hotel` VALUES (24, '黑甜青年旅舍', '前有小庭院和花圃，种有桂花树，后山有龙井茶园一片，欣赏风景视野极佳。旅店各项基本设施均干净整洁好用，提供洗衣，咖啡，简餐，调酒等服务，均低于本市平均物价。', 'img/hotel/24.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 18);
INSERT INTO `tab_hotel` VALUES (25, '李公堤国际青年旅舍', '旅舍地处吴中区李公堤，近四季路，周边餐饮、娱乐配套丰富，交通便捷。旅舍环境干净卫生，布置温馨舒适，房内设有24小时热水、无线WIFI等，让你感受到家的惬意与安心，是你出行理想的下榻之所。', 'img/hotel/25.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 18);
INSERT INTO `tab_hotel` VALUES (26, '寻宿青年旅舍', '位于古城市中心，平江路旁，独取一份安静与自在。手绘地图带你悠游老街和小巷，感受姑苏古城。自由温馨的氛围，带您感受闲适、优雅的苏式情怀。致力于打造背包客和旅行者在旅途中悠闲自在的栖居部落。', 'img/hotel/26.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 18);
INSERT INTO `tab_hotel` VALUES (27, '苏州草庐民宿', '苏州草庐民宿位于临顿路，与书院弄毗邻，交通十分便利。旅舍设有各类温馨客房，提供24小时热水淋浴、空调、电视、电话和宽带上网，让您在旅途中感受到“家”的温馨和舒适。', 'img/hotel/27.jpg', 1, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 18);
INSERT INTO `tab_hotel` VALUES (28, '国际青年旅舍', '国际青年旅舍位于南华路，距离厦门大学风景区、南普陀风景区步行约5分钟，距离厦门环岛路海滨度假风景区步行约10分钟，出行便利。', 'img/hotel/28.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 18);
INSERT INTO `tab_hotel` VALUES (29, '乐荷梦想青年旅舍', '乐荷是由一群8090后经营的青旅，旅舍极力为在路上的小伙伴们提供一个温馨舒适的住居环境，同时设身处地的挖掘小伙伴的需求，为大家提供全面体贴的服务。', 'img/hotel/29.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 18);
INSERT INTO `tab_hotel` VALUES (30, '不柒而遇青年旅舍', '旅舍客房整洁舒适，房内提供24小时热水、淋浴等。在这里可以发呆，聊天，懒床，看电视，泡澡，超级方便还能自助快速干衣，是商旅客人提供一个温暖的窝。', 'img/hotel/30.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 18);
INSERT INTO `tab_hotel` VALUES (31, '久栖· 周庄云端精品客栈', '客栈房间配置24小时热水，柜式空调，32液晶显示器，的福建安溪铁观音，wifi覆盖（光纤）。装修采用强烈的混搭，房间内饰为古风古韵，洗浴空间为地中海风。在这里，发现舒适的睡眠，星空，晚风。', 'img/hotel/31.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 19);
INSERT INTO `tab_hotel` VALUES (32, '雷雪山花园', '后院地中海的建造风格呈现浪漫的海洋气息，房间和公共区域在细节处理上特别的细腻精巧，又贴近自然的脉动，使整个院落拥有永恒的生命力。', 'img/hotel/32.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 19);
INSERT INTO `tab_hotel` VALUES (33, '又见平遥·梨园亭酒店', '房内布草全部采用康乃馨系列，洗护用品采用英国品牌SEVEN PLUS系列，加上酒店全程管家式的服务，相信会带给您一次不一样的文化体验。', 'img/hotel/33.jpg', 1, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 19);
INSERT INTO `tab_hotel` VALUES (34, '南浔原舍酒店', '客房采用简中式设计风格，布置禅意雅致、色调沉稳厚重；设有多款房型，房内设施设备齐全，满足你的品质生活所需。', 'img/hotel/34.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 19);
INSERT INTO `tab_hotel` VALUES (35, '浮生驿栈', '驿栈是一栋古朴的木质明清老宅，所有客房都是在原有房屋架构内全新装修，给人以古意与现代相结合的独特感受。', 'img/hotel/35.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 19);
INSERT INTO `tab_hotel` VALUES (36, '青白瓦宿', '青白瓦宿位于上海市青浦区朱家角西井街23弄6号，临近朱家角古镇，酒店别具特色，房间干净整洁，价格优惠，给你不一样的入住体验！', 'img/hotel/36.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 19);
INSERT INTO `tab_hotel` VALUES (37, '悦厢人文艺术客栈', '客栈的东门贯穿步行街新华路，与修真观、古戏台、矛盾故居、东栅景区西入口相邻，步行可达西栅景区。', 'img/hotel/37.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 19);
INSERT INTO `tab_hotel` VALUES (38, '半朵悠莲主题酒店', '每间客房都是精品，拥有日式、韩式、乡村田园式等不同的风格，让您足不出户也能体验各地的特色风情。', 'img/hotel/38.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 19);
INSERT INTO `tab_hotel` VALUES (39, '宏村艺术小镇客栈', '靠近宏村景区，步行前往可沿途欣赏秀丽的湖光山色，人文风情，交通十分便利，周边拥有便利的生活休闲区，有特色的音乐餐厅酒吧', 'img/hotel/39.jpg', 1, '磨西古镇海螺沟磨西镇贡嘎大道金山巷3号', '18015795635', 19);
INSERT INTO `tab_hotel` VALUES (40, '渔音绕梁民宿', '民宿三分之一空间规划为公共区域，以书为媒配备咖啡、茶、甜点，公区不定期举办服饰文化、国学等体验活动。', 'img/hotel/40.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 19);
INSERT INTO `tab_hotel` VALUES (41, '艾亚兰海滩酒店和广场', '苏梅岛机场位于距离该酒店大约2km的地方。著名的景点Mini Bar、Rai Ra Spa和苏梅岛旅行跟拍均可步行很短距离到达。', 'img/hotel/41.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 20);
INSERT INTO `tab_hotel` VALUES (42, '京屋日式旅馆', '距离JR名古屋火车站（JR Nagoya Train Station）有5分钟车程，提供带免费WiFi的简朴日式客房。客人可以享用日本料理，并在公共浴池放松身心。', 'img/hotel/42.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 20);
INSERT INTO `tab_hotel` VALUES (43, '格拉斯丽首尔酒店', '是您首尔之行的不二选择，从距离酒店几分钟路程的市厅站 地铁站出发，旅客可以很轻松到达城市里想去的地方。', 'img/hotel/43.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 20);
INSERT INTO `tab_hotel` VALUES (44, '坡豪亚酒店', '位于马里士他，毗邻中央商务区和购物胜地，从酒店步行约3分钟便可抵达诺维娜地铁站（Novena MRT），驱车4分钟即可抵达热门的乌节路，是您旅途的理想住处。', 'img/hotel/44.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 20);
INSERT INTO `tab_hotel` VALUES (45, '麦克拉伦酒店', '酒店很方便到达悉尼北火车站，仅有700m距离。只需步行至北悉尼地铁站，可以很便捷的到达城市的各个角落。Kirribilli医疗中心和Bradfield Park都在短距离内，入住酒店的旅客在该地区游览会很方便', 'img/hotel/45.jpg', 1, '双鹤路双鹤停车场旁（城隍庙斜对面路口进来50米）', '0872-2382222', 20);
INSERT INTO `tab_hotel` VALUES (46, '中央公园酒店', '是商务人士和观光游客前往纽约(NY)的理想下榻之处。您在住宿期间感受到更多愉悦享受酒店内设的24小时前台, 无障碍设施,行李存放服务, 无线网络, 代客泊车等设施。', 'img/hotel/41.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 20);
INSERT INTO `tab_hotel` VALUES (47, '万丽酒店', '拥有时尚美观的设计、广受赞誉的国际艺术品收藏，新近装修的酒店客房更配备各种高级设施。 所有入住我们行政楼层客房与套房的宾客均可享受豪华的毛绒浴袍、每日欧陆式早餐及更多体贴设施。', 'img/hotel/42.jpg', 1, '111 Moo 5, Chaweng Beach', '0898-38898888', 20);
INSERT INTO `tab_hotel` VALUES (48, '库克船长科纳皇宫酒店', '住在库克船长村的库克船长科纳皇宫酒店您将很靠近Kona Pacific Farmers Cooperative和库克船长纪念碑。该住宿加早餐旅馆紧邻Kapahukapu Manini Beach及艾米B.H.格林韦尔民族植物园。', 'img/hotel/43.jpg', 1, '过罗荃半岛天镜阁往双廊方向约1500米近洱海天镜阁景区、小普陀', '0872-2479088', 20);
INSERT INTO `tab_hotel` VALUES (49, '帕拉佐皇宫度假酒店', '建立于2007年的帕拉佐皇宫酒店延续了富丽堂皇的意大利文艺复兴时期的风格。帕拉佐皇宫酒店为您提供拉斯维加斯大道上最宽敞的套房。', 'img/hotel/44.jpg', 1, '古城绿玉路72号', '0898-38898888', 20);
INSERT INTO `tab_hotel` VALUES (50, '百乐门酒店', '坐落在中央商业区，百乐门酒店在西雅图占尽地理之宜。在短距离内，入住酒店的旅客在该地区游览会很方便。', 'img/hotel/45.jpg', 1, '沱江镇江南东路金家园326号', '0352-2382222', 20);
INSERT INTO `tab_hotel` VALUES (55, '校内', '撒旦飞洒地方撒旦是的豆腐干士大夫', 'img/hotel/61d59bd444c44ec3819e4e5d0f2ff177.jpeg', 0, '的首发式地方', '12345566', 5);
INSERT INTO `tab_hotel` VALUES (71, '潍坊-王城', '都是舒适的房间', 'img/hotel/38630f9016fa4e0abc921013627bd6c4.jpeg', 1, '山东省潍坊市', '', 5);
INSERT INTO `tab_hotel` VALUES (72, '潍坊-安丘', '撒旦发射点二委屈二位人', 'img/hotel/6727cecb8fa94c79a2fe091fda063a87.jpeg', 1, '', '', 5);
