INSERT INTO `tab_message` VALUES (30, 25, '草原景色壮丽辽阔，看骏马奔驰。塞罕坝森林湿地景色优美，蓝天白云空气清新。半天的越野车旅程，沿途风景如画，森林，草原，田地，沙丘，牛群，风光无限。大草原光污染小，夜晚星光灿烂。骑马射箭摔跤，体验民族特色，也意犹未尽。唯一的遗憾就是三天时间太短了。 住宿宽敞干净的，基本设施齐全，有电褥子，这个季节很实用。 饭菜口味还不错，卫生也不错。旅行团每天还提供一瓶瓶装水，很贴心。', '2022-01-16 00:57', '威海-公主湖双汽3日游');
INSERT INTO `tab_message` VALUES (49, 25, '通过该网站预订了青岛三日游，网站服务系统很好，比较人性化，但是预定的旅游团很不好，一路上让买买买，强制消费，希望能够有所改善。', '2022-02-03 14:40', '青岛三日游');
INSERT INTO `tab_message` VALUES (50, 25, '非常圆满的一次旅行体验：行程安排紧凑，动车到站点节约了很多时间，虽然每个景点停留时间不长（1-2小时），但也符合此类跟团游的特质；住宿体验一天比一天好，餐饮还合胃口（俺不挑食）。重点天气好！', '2022-03-07 10:46', '淄博旅行体验');
